/**
 * Encode basic credentials
 * @param {string} clientId - The client Id to encode
 * @param {string} clientSecret - The client secret to encode
 * @returns {string} base64 encoded clientId:clientSecret
 */
module.exports = a = async ({ params }) => {
  const clientId = params.clientId;
  const clientSecret = params.clientSecret;

  // If either value is missing, return an error
  if (!clientId || !clientSecret) {
    return false;
  }

  const encodedCredentials = new Buffer(clientId + ":" + clientSecret).toString("base64");

  return { 'encodedCredentials': encodedCredentials }
}

const decodeJWT = (token) => {
	const parts = token.split('.');
	let [header, payload] = parts.map((part) => Buffer.from(part, 'base64'));
	header = JSON.parse(header.toString());
	payload = JSON.parse(payload.toString());
	const decoded = { header, payload, signature: parts[2] };
	return decoded;
}

module.exports = a = async ({ params }) => {
	const { access_token } = params;
	const { payload: { exp } } = decodeJWT(access_token)
	return { 'tokenExpiration': exp }
}

const decodeJWT = (token) => {
	const parts = token?.split('.');
	let [header, payload] = parts.map((p) => Buffer.from(p, 'base64'));
	try {
		header = JSON.parse(header?.toString());
		payload = JSON.parse(payload?.toString());
	} catch (e) {
		header = {};
		payload = {};
	}
	return {
		header,
		payload,
		'signature': parts[2] || ''
	};
}

module.exports = a = async ({ params }) => {
	const { access_token, eventTimestamp } = params;
	const { payload: { exp = 0 } } = decodeJWT(access_token);
	// go from milliseconds to seconds
	let systemTimePlusOne = (eventTimestamp.substring(0, 10)) * 1;
	// give one second grace period
	systemTimePlusOne = systemTimePlusOne + 1;

	return {
		'tokenExpirationTime': exp,
		systemTimePlusOne,
		access_token,
		eventTimestamp
	}
}
